import React, {Component} from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import configureStore from './templates/config/configureStore';
import { Provider } from 'react-redux';

import Menu from './components/Menu.js';
import Home from './components/Home.js';
import About from './components/About.js';
import Portfolio from './components/Portfolio.js';
import Resume from './components/Work.js/index.js';
import Contact from './components/Contact.js';
import './css/App.css';

const store = configureStore();
class DynamicImport extends Component {
  state = {
    component: null
  }
  componentWillMount() {
    this.props.load()
    .then((mod) => {
      return mod;
    })
      .then((mod) => this.setState(() => ({
        component: mod.default
      })))
  }
  render() {
    return this.props.children(this.state.component)
  }
}


const Parllax = (props) => {
  return(
    <div className="main">
      <Menu />
        <div className="pimg1">
          <div className="ptext">
           <span className="border">
            <Home />
           </span>
          </div>
        </div>
        <section className="section section-light">
          <About />
        </section>

        <div className="pimg2">
          <div className="ptext">
           <span className="border">
            <Resume />
           </span>
          </div>
        </div>
        <section className="section section-light">
          <p>
          Languages & Frameworks:​ Javascript (ES6+), React, Redux, jQuery, HTML/CSS

          </p>
          <p>
          Databases:​ MongoDB, MySQL, PostgreSQL

          </p>
          <p>
          Other Technologies:​ NodeJS, Express, Jest/Enzyme, Mocha/Chai, Git, Babel, Webpack, AWS (EC2, S3), Docker, Git, Github, Trello, Styled-Components, Loader.io, New Relic, NGINX
          </p>
        </section>

        <div className="pimg3">
          <div className="ptext">
           <span className="border">
           More Coming Soon
           </span>
          </div>
        </div>
        <section className="section section-light">
          <h2>Section Three</h2>
          <Contact />
          <p>
          More Coming Soon
          </p>
        </section>
    </div>
  )
}

function App() {
  return (
    <Parllax />
  );
}

export default App;
